import './App.css';
import Home from './Pages/Home';
import Header from './Components/Header';
import "https://cdn.jsdelivr.net/npm/bootstrap@5.2.0-beta1/dist/css/bootstrap.min.css";

function App() {
  return (
    <div>
      <Header/>
      <Home/>
    </div>
  );
}

export default App;
